/**
 * Convert imageData obj to binary matrix
 * @param {Object} imageData canvas ImageData object
 * @return {Array} binay matrix
 *     
 */
function imageDataToBinaryMatrix(imageData) {
    const rgbaArr = imageData.data;
    const width = imageData.width;
    const height = imageData.height;

    const binaryMatrix = [];

    // rgba arr to binary arr
    const binaryArr = [];
    for (let i = 0; i < rgbaArr.length; i = i + 4) {
        // TODO: need updata; only fit for black and write img
        const grayValue = (rgbaArr[i] + rgbaArr[i + 1] + rgbaArr[i + 2]) / 3;
        if (grayValue >= 150) binaryArr.push(0);
        else binaryArr.push(1);
    }

    // binary arr to binary matrix
    for (let i = 0; i < binaryArr.length; i = i + width) {
        const raw = binaryArr.slice(i, i + width);
        binaryMatrix.push(raw);
    }

    return binaryMatrix;
}

